  const history = useHistory();
  const code = history.location.state.code;
  console.log(history);
  return (<div>
    <form>
      <div className="form-veri-code-group">
        <input type="text" placeholder="Nhập mã gồm 6 số..."/>
      </div>
      <div className="form-veri-code-group">
        <button type="submit">Xác nhận</button>
      </div>
    </form>
  </div>)
}

export default VeriCode;
